@import url("https://cdnjs.cloudflare.com/ajax/libs/malihu-custom-scrollbar-plugin/3.1.5/jquery.mCustomScrollbar.min.css");
@import url("https://use.fontawesome.com/releases/v5.0.13/js/solid.js");
@import url("https://use.fontawesome.com/releases/v5.0.13/js/fontawesome.js");

@import url("https://code.jquery.com/jquery-3.3.1.slim.min.js");

$dark-blue: #545871 ;
$dark-grey: #9597a6;
$medium-grey: #dadbe6;
$light-grey: #f0f1f7;
$pink: #ebd0ce;
$light-pink: #f7eceb;

@import url('https://fonts.googleapis.com/css?family=Poppins:300,400,500,600,700');

body {
    font-family: 'Poppins', sans-serif;
}

.wrapper {
    display: flex;
    width: 100%;
}

#contentfull {
    width: 100%;
    min-height: 100vh;
    position: absolute;
    top: 0;
    right: 0;
    left: 0;
}

#content {
    width: calc(100% - 250px);
    min-height: 100vh;
    position: absolute;
    top: 0;
    right: 0;
    transition: all 0.3s;
}

#content.active {
    width: 100%;
    transition: all 0.3s;
}

#description {
    color: white;
    background-image: url("assets/paginicial.png");
    background-repeat: no-repeat;
    background-attachment: scroll;
    background-position: center center;
    background-size: cover;
    text-align: left;
    padding-top: 10%;
    padding-bottom: 10%;

    #slogan {
        font-size: 2.5em;
        font-style: italic;
        margin-bottom: 25px;
        padding: 10px;
    }
}

#services {
    background-color: white;
    color: $dark-blue;

    .section-subheading {
        padding: 20px;
        margin-top: 20px;
        margin-bottom: 20px;
        font-size: 2.5em;
    }

    #service {
        padding: 10px;
        font-size: 1em;

        .fa-circle {
            color: $pink;
        }

        .service-heading {
            margin: 15px 0;
        }
    }
}

#contacts {
    background-color: $light-pink;
    text-align: left;
    padding: 15px;

    #contacttext {
        font-weight: 1000;
        margin-top: 20px;
        margin-bottom: 10px;
        font-size: 2.5em;
        color: $dark-blue;
    }

    #email {
        color: $dark-grey;
        font-weight: 500;
    }
}

#sidebar {
    width: 250px;
    height: 100vh;
    transition: all 0.3s;
    padding: 20px;
    position: fixed;
    top: 0;
    left: 0;
    background-color: $dark-blue;

    ul.components {
        padding: 20px 0;
    }

    .sec2 {
        transform: translate(0%, 60%);
    }

    .sec3 {
        transform: translate(0%, 100%);
    }

    a:hover, a:focus {
        color: inherit;
        text-decoration: none;
        color: $light-pink;
        transition: all 0.3s;
    }

    a {
        padding-top: 10px;
        font-size: 1em;
        display: block;
        color: white;
    }

    a[data-toggle="collapse"] {
        position: relative;
    }

    #dadosSubmenu {
        font-size: 0.9em !important;
        padding-left: 30px !important;
    }

    .dropdown-toggle::after {
        display: block;
        position: absolute;
        top: 60%;
        right: 70px;
    }
}

#sidebar.active {
    margin-left: -250px;
}

@media (max-width: 768px) {
    #sidebar {
        margin-left: -250px;
    }

    #sidebar.active {
        margin-left: 0;
    }

    #content {
        width: 100%;
    }

    #content.active {
        width: calc(100% - 250px);
    }

    #sidebarCollapse span {
        display: none;
    }
}

#registerask {
    font-size: 1.2em;
    margin-top: 10px;
    padding: 10px;

    a {
        color: $dark-blue;
        font-weight: 700;

        &:hover {
            color: $pink;
        }
    }
}

#button {
    font-weight: 500;
    border: none;
    border-radius: 45px;
    box-shadow: 0px 8px 15px rgba(0, 0, 0, 0.1);
    transition: all 0.3s ease 0s;
    cursor: pointer;
    outline: none;
    font-size: 1.2em;
    text-align: center;
    margin-left: 2%;
    padding-top: 10px;
    padding-bottom: 10px;
    padding-right: 40px;
    padding-left: 40px;

    &:hover{
        text-decoration: none;
        box-shadow: 0px 5px 5px rgba(2, 29, 44, 0.705);
        transform: translateY(-5px);
    }
}

#side {
    width: 350px;
    height: 100vh;
    padding: 20px;
    position: fixed;
    top: 0;
    left: 0;
    background-image: url("assets/side.png");
    background-color: $dark-blue;
    background-position: center; /* Center the image */
    background-repeat: no-repeat; /* Do not repeat the image */
    background-size: cover;

    .content-element {
        margin: auto;
        margin-top: 10%;
        width: 35%;
    }

    .circles-list ol {
        list-style-type: none;
        margin-left: 1.25em;
        padding-left: 2.5em;
        border-left: 1px solid white;
        position: relative;
        counter-reset: li-counter;
    }

    .circles-list ol>li {
        position: relative;
        margin-bottom: 3.125em;
        clear: both;
        color: white;
        font-weight: 600;
    }

    .circles-list ol>li:before {
        position: absolute;
        top: 0em;
        left: -3.5em;
        width: 1.85em;
        height: 1.85em;
        line-height: 2.2em;
        color: white;
        border: 2px solid white;
        border-radius: 50%;
        content: counter(li-counter);
        background-color: white;
    }

    #step {
        font-weight: 700;
        color: $pink;
    }
}

#side2 {
    width: calc(100% - 350px);
    min-height: 100vh;
    position: absolute;
    top: 0;
    right: 0;
    transition: all 0.3s;
    background-color: $light-pink;
}

@media (max-width: 768px) {
    #avatar {
        width: 100px;
    }
}

@media (max-width: 768px) {
    #side2 {
        width: 100%;
    }
}

#userRegister {
  background-color: $light-pink;
}

